import React, { Component } from "react";
 
class Faculty extends Component {
  render() {
    return (
      <div>
        <h1>Welcome to Faculty</h1>
        <h3> List of Courses </h3>
        <li> Data Science
         <a href="http://forum.kirupa.com"></a>.
        </li>
        <li> Machine Learning
         <a href="http://forum.kirupa.com"></a>.
        </li>
        <li> Big Data
         <a href="http://forum.kirupa.com"></a>.
        </li>
      </div>
    );
  }
}
 
export default Faculty;
